from data_loader import get_datafrom models import define_modelimport timeitimport warningswarnings.filterwarnings(action='ignore')import sysimport osif not sys.warnoptions:    warnings.simplefilter("ignore")    os.environ["PYTHONWARNINGS"] = "ignore" # Also affecmodel_names= ['Support vector classification','Decision tree classification','Random forest classification','Neural network classification']if __name__ == '__main__':    ## data loading    tic = timeit.default_timer()    X_train,  X_valid, y_train, y_valid = get_data()    print('ok (time: %.4fs)' % (timeit.default_timer() - tic))    print(X_train.shape, '\t', y_train.shape)    print(X_valid.shape, '\t', y_valid.shape)    for model_name_id, model_name in enumerate(model_names):        tic = timeit.default_timer()        print('    > (%d/%d) training %s...' % (model_name_id + 1, len(model_names), model_name))        define_model[model_name_id](X_train, y_train, X_valid, y_valid)        print('    ok (time: %.4fs)' % (timeit.default_timer() - tic))